import React, { useState,useEffect } from 'react';

const Home=()=>{

    const [content,setContent]=useState('');

    useEffect(()=>{
        fetch('/home',{
            method:'GET',
            headers:'application/json'
        })
        .then(res=>{
            if(res.ok){
                return res.json();
            }
            throw res;
        })
        .then(data=>{
            setContent(data);
        })
        .catch(err=>console.log(err))
    },[]);

    return(
        <div>
            <h1>{}</h1>
        </div>
    );
}

export default Home;
